import React from 'react'
import { Button } from '../Button/Button'

function LoginButton() {
  const user = JSON.parse(localStorage.getItem('currentUser'))
  return (
    <div>
      {user ? (
        <Button>{user.first_name}</Button>
      ) : (
        <Button>Login</Button>
      )}
    </div>
  )
}

export default LoginButton
